          "distinct": true,
          "id": "9365aef0636144f1bcf0695db68681823a889fe0",
          "message": "feat(pluginsdk): add Prometheus metrics instrumentation for plugins (#119)\n\n## Summary\n\n- Add opt-in Prometheus metrics interceptor for gRPC request counting\n- Provide optional HTTP server helper for metrics endpoint exposure\n- Include comprehensive tests, benchmarks, and documentation\n\n## Changes\n\n### sdk/go/pluginsdk\n\n1. **New file `metrics.go`**: Core metrics implementation\n   - `MetricsUnaryServerInterceptor(pluginName)`: gRPC interceptor\n   - `NewPluginMetrics(pluginName)`: Creates registry with metrics\n   - `MetricsInterceptorWithRegistry(metrics)`: Custom registry support\n   - `StartMetricsServer(config)`: Optional HTTP server\n\n2. **Metrics collected**:\n   - `pulumicost_plugin_requests_total`: Counter with method/code/name\n   - `pulumicost_plugin_request_duration_seconds`: Histogram\n   - Fixed buckets: 5ms to 5s (10 buckets)\n\n3. **Tests (`metrics_test.go`)**: 15+ test functions\n   - Counter increment and histogram observation\n   - Error handling with gRPC status codes\n   - Interceptor chaining with TracingUnaryServerInterceptor\n   - HTTP server startup, custom port/path, graceful shutdown\n   - Per-method labels and 1000-request accuracy validation\n\n4. **Benchmarks (`metrics_benchmark_test.go`)**:\n   - `BenchmarkMetricsInterceptor_Overhead`: ~510 ns/op, 0 allocs\n   - Meets SC-004 requirement: <1% overhead for realistic handlers\n\n5. **Documentation**: README updated with metrics section and examples\n\n### Dependencies\n\n- Added `github.com/prometheus/client_golang` v1.23.2\n- Added `github.com/prometheus/client_model` v0.6.2\n\n## Verification\n\n- [x] `make lint` passes\n- [x] `make test` passes\n- [x] Benchmarks meet performance requirements\n- [x] All 41 tasks in tasks.md completed\n\nCloses #80",
